import React from 'react';
import PostCard from '../PostCard/PostCard';

// import './PostCardList.css';

const PostCardList = ({reservePlate,cards}) => {
	const allCards = cards.map((card,i) => {
		return(
			<PostCard 
			onReserveClick = {()=>reservePlate(i)}
			key ={i}
			plateName = {cards[i].title}
			price = {cards[i].id}
			picture = 'https://images.all-free-download.com/images/graphicthumb/fries_and_steak_on_plate_193268.jpg'
			/>
		)
	})


	return(
		<div style = {{marginTop:'10px'}}>

			{allCards}

		</div>

	)

}
export default PostCardList;
